import React, { useEffect } from 'react';
import { Users } from 'lucide-react';

const VideoDisplay = ({
  remoteVideoRef,
  localVideoRef,
  isSpeakerOff,
  isVideoOff,
  doctor,
  connectionQuality,
  reconnectAttempt,
  showControls,
  isDarkMode,
  colors,
  children
}) => {
  // Dark mode specific colors
  const videoOffBg = isDarkMode 
    ? `linear-gradient(135deg, ${colors.darkBg}, #031838)` 
    : `linear-gradient(135deg, ${colors.primaryDark}, #031838)`;

  const videoOnBg = isDarkMode
    ? `linear-gradient(45deg, #0a0a0a, #1e1e1e)`
    : `linear-gradient(45deg, #1e1e1e, #0a0a0a)`;

  // Add useEffect to debug and ensure local video display
  useEffect(() => {
    // Force display of local video for debugging
    const checkVideoElement = setInterval(() => {
      if (localVideoRef.current && !localVideoRef.current.srcObject) {
        console.log("Local video ref exists but has no srcObject, trying to get user media");
        navigator.mediaDevices.getUserMedia({ video: true, audio: true })
          .then(stream => {
            console.log("Got local stream with tracks:", 
              stream.getTracks().map(t => `${t.kind}:${t.readyState}`).join(', '));
            localVideoRef.current.srcObject = stream;
          })
          .catch(err => console.error("Failed to get user media:", err));
      } else if (localVideoRef.current && localVideoRef.current.srcObject) {
        console.log("Local video has srcObject with tracks:", 
          localVideoRef.current.srcObject.getTracks().map(t => `${t.kind}:${t.readyState}`).join(', '));
      }
    }, 2000);

    return () => clearInterval(checkVideoElement);
  }, [localVideoRef]);

  useEffect(() => {
    // Debug information about remote video stream
    if (remoteVideoRef.current && remoteVideoRef.current.srcObject) {
      const stream = remoteVideoRef.current.srcObject;
      console.log("Remote video has stream with tracks:", 
        stream.getTracks().map(t => `${t.kind}:${t.readyState}`).join(', '));

      // If remote stream has active tracks, log a clear message
      if (stream.getTracks().length > 0) {
        console.log("🟢 IMPORTANT: Remote media IS available and should be displaying");
      }

      // Add track event listeners to catch when new tracks are added
      const trackAddedHandler = () => {
        console.log("New track added to remote stream");
      };

      stream.addEventListener('addtrack', trackAddedHandler);

      return () => {
        stream.removeEventListener('addtrack', trackAddedHandler);
      };
    } else {
      console.log("⚠️ Remote video ref exists but has no srcObject");
    }
  }, [remoteVideoRef.current?.srcObject]);

  return (
    <>
      {/* Doctor video (remote) */}
      <div className="absolute inset-0 bg-black dark-mode-transition">
        <div className="h-full relative">
          {/* Remote video element */}
          <video
            ref={remoteVideoRef}
            autoPlay
            playsInline
            muted={isSpeakerOff}
            className="w-full h-full object-cover"
          />

          {/* Pass children (call header & connection status) */}
          {children}

          {/* Reconnecting indicator */}
          {connectionQuality !== 'good' && reconnectAttempt > 0 && (
            <div 
              className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 px-4 py-2 rounded-lg"
              style={{ 
                backgroundColor: 'rgba(0, 0, 0, 0.7)',
                backdropFilter: 'blur(4px)'
              }}
            >
              <div className="flex flex-col items-center">
                <div className="w-8 h-8 rounded-full border-2 border-white border-opacity-20 border-t-white animate-spin mb-2"></div>
                <span className="text-sm text-white font-medium">Reconnecting{reconnectAttempt > 1 ? ` (${reconnectAttempt})` : ''}...</span>
              </div>
            </div>
          )}

          {/* Fallback when remote video is off or not available yet */}
          {isVideoOff && (
            <div className="absolute inset-0 flex items-center justify-center dark-mode-transition"
                 style={{ background: isDarkMode ? colors.darkBg : '#000811' }}>
              <div className="w-32 h-32 rounded-full overflow-hidden border-4 border-white border-opacity-20">
                <img src={doctor?.image || '/User_1.png'} alt={doctor?.name || 'Doctor'} className="w-full h-full object-cover" />
              </div>
            </div>
          )}
        </div>
      </div>

      {/* User video (local) - MODIFIED FOR VISIBILITY */}
      <div className="absolute bottom-24 right-4 w-32 h-48 rounded-xl overflow-hidden border-4 border-white"
           style={{ 
             boxShadow: '0 8px 32px rgba(0, 0, 0, 0.8)',
             zIndex: 999, // Ensure it's above everything
             backgroundColor: 'black', // Add background for visibility
             transform: showControls ? 'scale(1)' : 'scale(0.95)',
             transition: 'all 0.3s ease'
           }}>
        {/* Local video element */}
        <video
  ref={remoteVideoRef}
  autoPlay
  playsInline
  muted={isSpeakerOff}
  className="w-full h-full object-cover"
  onLoadedMetadata={() => console.log("Remote video loadedmetadata event")}
  onCanPlay={() => console.log("Remote video canplay event")}
  style={{ 
    border: '2px solid rgba(0, 255, 0, 0.5)',  // Green border to see if it's rendering
    display: 'block'  // Force display
  }}
  onError={(e) => console.error("Remote video error:", e)}
/>

        {/* Background when video is off */}
        <div className={`absolute inset-0 dark-mode-transition ${isVideoOff ? '' : 'hidden'}`} 
             style={{ background: videoOffBg }}>
        </div>

        {/* User placeholder when video is off */}
        {isVideoOff && (
          <div className="absolute inset-0 flex items-center justify-center">
            <div className="w-12 h-12 rounded-full bg-white bg-opacity-10 flex items-center justify-center">
              <Users size={18} className="text-white" />
            </div>
          </div>
        )}

        {/* Debug text overlay */}
        <div className="absolute top-0 left-0 bg-black bg-opacity-50 text-white text-xs p-1">
          {isVideoOff ? "Video Off" : "Video On"}
        </div>
      </div>
    </>
  );
};

export default VideoDisplay;
